import React from "react";
import ProfileImageWithDefault from "./ProfileImageWithDefault";
import { Link } from "react-router-dom";
import { format } from "timeago.js";
import { useTranslation } from "react-i18next";

const PostView = (props) => {
  const { post } = props;
  const { user, content, timestamp, fileAttachment } = post;
  const { username, displayName, image } = user;

  const { i18n } = useTranslation();

  const formatted = format(timestamp, i18n.language);
  return (
    <div className="card p-1">
      <div className="d-flex">
        <ProfileImageWithDefault
          Link={`/users/${username}`}
          image={image}
          width="32"
          height="32"
          className="rounded-circle m-1"
        />
        <div className="flex-fill m-auto px-2">
          <Link
            to={`/users/${username}`}
            className="text-dark"
            style={{ textDecoration: "none" }}
          >
            <h6 className="d-inline">
              <span>{displayName}</span>
              <span className="text-muted"> @{username}</span>
              <i className="material-icons text-info align-items-center ms-2">verified</i>
            </h6>
            <span> · </span>
            <span>{formatted}</span>
          </Link>
        </div>
        <div class="dropdown">
    <button class="btn btn-secondary dropdown-toggle" type="button" id="dropdownMenuButton" data-bs-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
        <span class="visually-hidden">Açılır Menü</span>
    </button>
    <ul class="dropdown-menu" aria-labelledby="dropdownMenuButton">
        <li><a class="dropdown-item" href="#">Seçenek 1</a></li>
        <li><a class="dropdown-item" href="#">Seçenek 2</a></li>
        <li><a class="dropdown-item" href="#">Seçenek 3</a></li>
    </ul>
</div>

        <button className="btn btn-delete-link"><i class="fa-solid fa-ellipsis"></i></button>
      </div>
      <div className="px-5 py-2"> {content} </div>
      {fileAttachment && (
        <div className="ps-5">
          {fileAttachment.fileType.startsWith("image") && (
            <img
              className="img-fluid img-thumbnail rounded"
              style={{ maxWidth: "100%", maxHeight: "395px" }}
              src={"images/attachment/" + fileAttachment.name}
              alt={content}
            />
          )}
          {!fileAttachment.fileType.startsWith("image") && (
            <strong>
              <em>Post has unkown attachment</em>
            </strong>
          )}
        </div>
      )}
      <hr class="text-black-50 my-1" />
      <div className="d-flex justify-content-around pb-1 py-1">
        <i class="fa-regular fa-comment"></i>
        <i class="fa-regular fa-window-restore"></i>
        <i class="fa-regular fa-heart"></i>
        <i class="fa-regular fa-bookmark"></i>
        <i class="fa-regular fa-share-from-square"></i>
      </div>
    </div>
  );
};

export default PostView;
